package peizhaoo.eecs.uci.edu.assignment3discussion2.controller;

import android.graphics.Canvas;
import android.view.SurfaceHolder;

import peizhaoo.eecs.uci.edu.assignment3discussion2.view.GameView;

/**
 * Created by peizhaoo on 5/17/17.
 */
public class GameThread extends Thread {
    private GameController controller;
    private GameView gameView;

    public GameThread(GameController controller, GameView gameView) {
        this.controller = controller;
        this.gameView = gameView;
    }

    public void run() {
        SurfaceHolder sh = gameView.getHolder();
        while (true) {
            Canvas canvas = sh.lockCanvas();
            if (canvas != null) {
                controller.update();
                gameView.draw(canvas);
                sh.unlockCanvasAndPost(canvas);
            }
        }
    }
}

